def dispense(amount: int):
    balance = 2500
    withdrawal = {1: 1000, 2: 2000, 3: 5000, 4: 10000, 5: 20000}
    if balance >= withdrawal[amount]:
        print(f"paying =N={withdrawal[amount]}")
		balance -= withdrawal[amount]
    else:
