        elif amount == 3:
            dispense(amount)
        elif amount == 4:
            dispense(amount)
        elif amount == 5:
            dispense(amount)
        elif amount == 6:
            specific_amount = int(
                input("enter amount\namount should be a multiple of =N=1000\n"))
            if specific_amount % 1000:
                print("amount must be a multiple of =N=1000")
