#include <bits/stdc++.h>


using namespace std;

//#define int long long

const long long INF = 1e9 + 7;
const int MAXN = 200 + 10;
const int N = 1e5 + 10;

int last[MAXN][MAXN], rem[MAXN][MAXN];
vector<int> ans;

void get_ans(int l, int r, bool flag = false) {
    if (!flag) {
        if (last[l][r] == l) {
            get_ans(l, r, true);
            return;
        }
        get_ans(l, last[l][r], flag);
        get_ans(last[l][r], r, flag);
    } else {
        if (rem[l][r] == l) {
            return;
        }
        get_ans(l, rem[l][r], flag);
        get_ans(rem[l][r], r, flag);
        ans.emplace_back(rem[l][r] + 1);
    }
}

void solve() {
    int n;
    cin >> n;
    vector<int> a(n);
    for (int i = 0; i < n; ++i) {
        cin >> a[i];
    }
    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < n; ++j) {
            rem[i][j] = INF;
        }
    }
    for (int i = 0; i + 1 < n; ++i) {
        rem[i][i + 1] = i;
    }
    for (int len = 3; len <= n; ++len) {
        for (int l = 0; l + len - 1 < n; ++l) {
            int r = l + len - 1;
            for (int m = l + 1; m < r; ++m) {
                if (rem[l][m] != INF && rem[m][r] != INF) {
                    if (a[m] > a[l] && a[m] > a[r] || a[m] < a[l] && a[m] < a[r]) {
                        rem[l][r] = m;
                    }
                }
            }
        }
    }

    int dp[n][n];

    for (int i = 0; i < n; ++i) {
        for (int j = 0; j < n; ++j) {
            dp[i][j] = INF;
            last[i][j] = INF;
        }
    }

    for (int len = 2; len <= n; ++len) {
        for (int l = 0; l + len - 1 < n; ++l) {
            int r = l + len - 1;
            if (a[l] > a[r]) {
                continue;
            }
            if (rem[l][r] != INF) {
                dp[l][r] = len - 2;
                last[l][r] = l;
            }

            for (int m = l + 1; m < r; ++m) {
                if (a[m] < a[l] || a[m] > a[r]) {
                    continue;
                }
                if (dp[l][r] > dp[l][m] + dp[m][r]) {
                    dp[l][r] = dp[l][m] + dp[m][r];
                    last[l][r] = m;
                }
            }
        }
    }
    if (last[0][n - 1] == INF) {
        cout << -1 << '\n';
    } else {
        get_ans(0, n - 1, false);
        cout << ans.size() << '\n';
        for (auto& i: ans) {
            cout << i << '\n';
        }
    }
}

signed main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.tie(nullptr);

    int tt = 1;
//    cin >> tt;
    while (tt--) {
        solve();
    }
}

#include <algorithm>
#include <iostream>
#include <iomanip>
#include <vector>
#include <array>
#include <set>
#include <map>
#include <deque>

using namespace std;

//#define int long long
#pragma comment(linker,"/STACK:1000000000,1000000000")

const int INF = 1e9 + 7;
const int MAXN = 20010;
const int N = 1e5 + 10;
const int MOD = 1e9 + 7;

void init_dp(vector<vector<int>>& dp) {
    for (int i = 0; i < dp.size(); ++i) {
        for (int j = 0; j < dp[i].size(); ++j) {
            dp[i][j] = INF;
        }
    }
}

struct min_on_window {
    deque<pair<int, int>> d;

    void push(int x, int ind) {
        while (!d.empty() && d.back().first >= x) {
            d.pop_back();
        }
        d.emplace_back(x, ind);
    }

    void pop(int ind) {
        if (!d.empty() && d.front().second == ind) {
            d.pop_front();
        }
    }

    int get_min() {
        return (d.empty() ? INF : d.front().first);
    }
};

signed main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.tie(nullptr);

    int n, w, l, min_r, max_r;
    cin >> n >> w >> l >> min_r >> max_r;
    vector<int> a(l + 1), pref_sum(l + 1);
    pref_sum[0] = 0;
    for (int i = 1; i <= l; ++i) {
        cin >> a[i];
        pref_sum[i] = pref_sum[i - 1] + a[i];
    }

    vector<min_on_window> mini(n + 1);
    vector<vector<int>> dp(l + 1, vector<int>(n + 1));
    init_dp(dp);
    for (int i = min_r + w; i <= l - min_r; ++i) {
        for (int j = 0; j <= n; ++j) {
            mini[j].push(dp[i - w - min_r][j], i - w - min_r);
            if (i - w - max_r - 1 >= 0) {
                mini[j].pop(i - w - max_r - 1);
            }
        }

        if (i - w <= max_r) {
            dp[i][1] = pref_sum[i] - pref_sum[i - w];
        }
        for (int j = 2; j <= n; ++j) {
            dp[i][j] = min(INF, pref_sum[i] - pref_sum[i - w] + mini[j - 1].get_min());
        }
    }

    int ans = INF;
    for (int i = max(0, l - max_r); i <= l - min_r; ++i) {
        ans = min(ans, dp[i][n]);
    }
    if (ans == INF) {
        cout << "No solution.\n";
    } else {
        cout << ans << '\n';
    }
}

#include <bits/stdc++.h>

using namespace std;

long long largestRectangleArea(vector<int>& heights) {
    ios::sync_with_stdio(false);
    cin.tie(nullptr);

    stack<int> a;
    long long maxArea = 0;

    for (int i = 0; i < heights.size(); i++) {
        while (!a.empty() && heights[i] < heights[a.top()]) {
            int topIndex = a.top();
            a.pop();
            long long width = a.empty() ? i : i - a.top() - 1;
            maxArea = max(maxArea, (long long)heights[topIndex] * width);
        }
        a.push(i);
    }

    while (!a.empty()) {
        int topIndex = a.top();
        a.pop();
        long long width = a.empty() ? heights.size() : heights.size() - a.top() - 1;
        maxArea = max(maxArea, (long long)heights[topIndex] * width);
    }

    return maxArea;
}

int main() {
    int n;
    cin >> n;

    vector<int> h(n);
    for (int i = 0; i < n; i++) {
        cin >> h[i];
    }

    ios::sync_with_stdio(false);
    cin.tie(nullptr);

    stack<int> a;
    long long result = 0;

    for (int i = 0; i < h.size(); i++) {
        while (!a.empty() && h[i] < h[a.top()]) {
            int m = a.top();
            a.pop();
            long long width = a.empty() ? i : i - a.top() - 1;
            result = max(result, (long long)h[m] * width);
        }
        a.push(i);
    }

    while (!a.empty()) {
        int topIndex = a.top();
        a.pop();
        long long w = a.empty() ? h.size() : h.size() - a.top() - 1;
        result = max(result, (long long)h[topIndex] * w);
    }

    cout << result << endl;

    return 0;
}

interface Observer {
    update(operation: string, amount: number): void;
}

class BankAccount {
    private observers: Observer[] = [];
    private balance: number = 0;

    addObserver(observer: Observer): void {
        this.observers.push(observer);
    }

    deposit(amount: number): void {
        this.balance += amount;
        this.notifyObservers('deposit', amount);
    }

    withdraw(amount: number): void {
        if (amount > this.balance) {
            console.log('Insufficient funds');
            return;
        }
        this.balance -= amount;
        this.notifyObservers('withdraw', amount);
    }

    private notifyObservers(operation: string, amount: number): void {
        for (let observer of this.observers) {
            observer.update(operation, amount);
        }
    }
}

class SimpleLoggerObserver implements Observer {
    update(operation: string, amount: number): void {
        console.log(`A ${operation} operation was performed for the amount of: ${amount}`);
    }
}

class IRSObserver implements Observer {
    update(operation: string, amount: number): void {
        if (operation === 'deposit' && amount > 100000) {
            console.log('A suspected operation was carried out');
        }
    }
}

class BankObserver implements Observer {
    update(operation: string, amount: number): void {
        console.log(`The fee for performing the ${operation} operation is: ${amount * 0.1}`);
    }
}

