// Компонент для выбора нескольких значений из справочника apps.cd_answers.
// Выбранные варианты записываются через запятую

import React, { forwardRef, useImperativeHandle, useState, useRef, useEffect } from 'react';
import { ICustomEditorRef, ICustomEditorProps } from '@iserv/iflow-utils/src/types/editView';
import { getRuntimeEnv } from '@iserv/iflow-utils/src/utils/env/runtimeEnv';
import DropDownBox from 'devextreme-react/drop-down-box';
import DataGrid, { Selection, Paging, FilterRow, Scrolling } from 'devextreme-react/data-grid';
import { QueryTools, Utils } from '@iserv/iflow-utils';
import _ from 'lodash';

const JSON_RPC_URL = getRuntimeEnv('JSON_RPC_URL') || process.env.JSON_RPC_URL;

// Заголовок, который будет указан в списке выбора
const variantTitle = 'Вариант';

const gridColumns = [variantTitle];

export const DropDownWithMultiEditor = forwardRef((p: ICustomEditorProps, ref) => {
  const [gridDataSource, setGridDataSorce] = useState([]);
  const [gridBoxValue, setGridBoxValue] = useState([]);
  const dropDownRef = useRef(null);

  const { QueryBuilder: Query, QueryFilterProxy: Filter } = QueryTools;
  const { getToken } = Utils;
  Query.token = getToken();
  Query.url = JSON_RPC_URL;

  const formatAndSetData = data => {
    const datasource = data.map(el => {
      return {
        ID: el.id,
        Вариант: el.c_variant,
      };
    });
    setGridDataSorce(datasource);
  };

  const getData = async (type: string) => {
    const qb = Query.setTable('Domain.Apps_CD_Answers')
      .setCols(['id', 'c_variant'])
      .setFilter(Filter(`C_Type=${type}`));
    const res = await qb.exec('get');
    if (Array.isArray(res) && res.length > 0) {
      res.sort((a, b) => a.c_variant.localeCompare(b.c_variant));
      formatAndSetData(res);
    }
  };
  // Загружаем данные из справочника, в зависимости от поля, т.к. данный компонент может быть использован в разных полях
  useEffect(() => {
    let type = '';

    switch (p.dataField) {
      case 'C_Medical_Supervision':
        type = 'med_supervision';
        break;
      case 'test':
        type = 'test';
        break;
      default:
        break;
    }
    void getData(type);
  }, []);

  const dataGridOnSelectionChanged = e => {
    setGridBoxValue((e.selectedRowKeys.length && e.selectedRowKeys) || []);
  };

  const syncDataGridSelection = e => {
    setGridBoxValue(e.value || []);
  };

  useEffect(() => {
    if (dropDownRef.current) {
      const variantIds = dropDownRef.current.instance.option('value');

      if (Array.isArray(variantIds)) {
        let result = '';
        variantIds.forEach(id => {
          const found = _.find(gridDataSource, el => el.ID === id);
          if (found) {
            result += result === '' ? found[variantTitle] : `, ${found[variantTitle]}`;
          }
        });
        p.outerOptions.onValueChanged({ value: result, dataField: p.dataField });
      }
    }
  }, [gridBoxValue]);

  useEffect(() => {
    if (p.outerOptions.formData[p.dataField]) {
      const variants = p.outerOptions.formData[p.dataField].split(',');
      if (variants.length > 0) {
        const res = [];
        variants.forEach(variant => {
          const found = _.find(gridDataSource, el => el[variantTitle] === variant.trim());
          if (found) {
            res.push(found.ID);
          }
        });
        setGridBoxValue(res);
      }
    }
  }, [gridDataSource]);

  const dataGridRender = () => {
    return gridDataSource.length > 0 ? (
      <DataGrid
        height={345}
        dataSource={gridDataSource}
        columns={gridColumns}
        hoverStateEnabled={true}
        selectedRowKeys={gridBoxValue}
        onSelectionChanged={dataGridOnSelectionChanged}
        showBorders={true}
        keyExpr={'ID'}
      >
        <Selection mode="multiple" />
        <Scrolling mode="virtual" />
        <Paging enabled={true} pageSize={10} />
        <FilterRow visible={true} />
      </DataGrid>
    ) : (
      <div>Загрузка...</div>
    );
  };

  useImperativeHandle(
    ref,
    (): ICustomEditorRef => ({
      setValidType: () => _.noop(),
      getLabelText: () => '',
      validate: () => ({ isValid: true } as any),
      setValue: () => _.noop(),
      isNewCustomEditor: () => true,
      disableValidator: () => _.noop(),
      enableValidator: () => _.noop(),
      focusOn: () => _.noop(),
      disable: () => _.noop(),
      enable: () => _.noop(),
      setReadOnly: () => _.noop(),
      refreshDataBeforeNextOpen: () => _.noop(),
    }),
    [],
  );

  return gridDataSource.length > 0 ? (
    <DropDownBox
      ref={dropDownRef}
      value={gridBoxValue}
      valueExpr="ID"
      deferRendering={false}
      displayExpr={variantTitle}
      placeholder="Укажите из списка..."
      showClearButton={true}
      dataSource={gridDataSource}
      onValueChanged={syncDataGridSelection}
      contentRender={dataGridRender}
    />
  ) : (
    <div>Загрузка справочника...</div>
  );
});

import idautils
import idc
import idaapi

output_file = "result.txt"

def find_mov_instructions():
    with open(output_file, "w") as file:
        imagebase = idaapi.get_imagebase()
        lea_address = None
        call_address = None
        for seg_ea in idautils.Segments():
            seg_name = idc.get_segm_name(seg_ea)
            if seg_name == ".text":
                for head in idautils.Heads(seg_ea, idc.get_segm_end(seg_ea)):
                    mnem = idc.print_insn_mnem(head)
                    if mnem == "lea":
                        opnd_type = idc.get_operand_type(head, 1)
                        if opnd_type == idc.o_mem:
                            opnd = idc.get_operand_value(head, 1)
                            if idc.get_segm_name(opnd) == ".text" and idc.print_insn_mnem(opnd) == "sub":
                                lea_address = head
                                lea_hex_view = get_hex_view(lea_address)
                                sub_address = opnd
                                sub_hex_view = get_hex_view(sub_address)
                                mov_address = None
                                mov_value_hex = None
                                asm = None
                    elif mnem == "call":
                        call_address = head
                    elif mnem == "mov":
                        if lea_address and call_address and not mov_address:
                            mov_address = head
                            mov_value_hex = get_mov_value_hex(mov_address)
                            if is_valid_mov_value(mov_value_hex):
                                asm = idc.GetDisasm(mov_address)
                                if "[" not in asm and "00000" not in mov_value_hex:
                                    file.write("lea Address: {}\n".format(hex(lea_address)))
                                    file.write("lea Address - Imagebase: {}\n".format(hex(lea_address - imagebase)))
                                    file.write("lea sub Hex View: {}\n".format(sub_hex_view))
                                    file.write("mov Address: {}\n".format(hex(mov_address)))
                                    file.write("mov value: {}\n".format(mov_value_hex))
                                    file.write("call Address: {}\n".format(hex(call_address)))
                                    file.write("mov ASM: {}\n".format(asm))
                                    file.write("\n")
                                    file.write("\n")
                    else:
                        lea_address = None
                        call_address = None

def get_hex_view(address):
    bytes_str = ""
    bytes = idc.get_bytes(address, 16)
    for byte in bytes:
        bytes_str += "{:02X} ".format(byte)
    return bytes_str.strip()

def get_mov_value_hex(address):
    mov_value = idc.get_operand_value(address, 1)
    mov_value_hex = "{:016X}".format(mov_value)
    return mov_value_hex

def is_valid_mov_value(mov_value_hex):
    return len(mov_value_hex) == 16 and "00000" not in mov_value_hex

find_mov_instructions()

